import "./App.css";
import React from "react";
import { Container, Grid } from "@material-ui/core";
function App() {
  return (
    <Container>
      <Grid container>
        <Grid item xs={12} sm={12} md={4} lg={3}>
          <Profile/>
        </Grid>
        <Grid item xs>
          xyz
        </Grid>
      </Grid>
    </Container>
  );
}

export default App;
